import { SET_BOOKING_PAST_VIEW, SET_BOOKING_UPCOMING_VIEW, SET_BOOKING_PENDING_VIEW} from "./types";

export const bookingView = view => dispatch => {
    console.log('-------hello', view)
    if (view === 'pending'){
        dispatch({
            type: SET_BOOKING_PENDING_VIEW,
            view: view
        });
    } else if (view === 'upcoming') {
        dispatch({
            type: SET_BOOKING_UPCOMING_VIEW,
            view: view
        });
    } else if (view === 'past') {
        dispatch({
            type: SET_BOOKING_PAST_VIEW,
            view: view
        });
    } else {
        dispatch({
            type: SET_BOOKING_PENDING_VIEW,
            view: view
        });
    }

}
